import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonList, IonItem } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab3.css';

const arr = [
  {
    name: 'Hoang',
    pfp: "https://ca.slack-edge.com/T0171J44GNS-U0187P2F5T4-b1fd59458e4a-512",
    gender: 'female',
    friend_gender: 'female',
    interest: 'coding',
    available: 'aug 8th'
  }
]

const Tab3: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>settings</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonList>
            {arr.map(elem => (
              <>
                <IonItem key={elem.name}>
                  <IonLabel>
                      My gender is {elem.gender}
                  </IonLabel>
                  <IonLabel>
                      My interest is {elem.interest}
                  </IonLabel>
                </IonItem>
              </>

            ))}
        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Tab3;
